import React, { useEffect, useState } from "react"

import { useParams } from "react-router";
import { useLocation } from "react-router";

const TestPage = () => {

    const location = useLocation();
    console.log(location.state);

    const code = location.state.codeBlocks[0].code;
    const id = location.state.codeBlocks[0]._id;
    // const solution = location.state.CodeBlocks[0].solution;

    console.log(code);
    console.log(id);

    const [value, setValue] = useState("code"); 

    const handleSubmit = () => {
        alert(code)
    };

    const handleChange = event => {
        setValue(event.target.value)
    };


    return(
        <div>
            <h1>Change Your Code Here</h1>
            <h2>{code}</h2>
             <input value={code} onChange={handleChange}/>
            <button onClick={handleSubmit}>Sumbit Soluton</button>
        </div>

    )
};

export default TestPage;
